import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";
import './main.css'


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

 
 function toggle(){
  if(document.getElementById('mySidebar'). style.display ==='block' ){
    document.getElementById('mySidebar').style.display = 'none'
  }else{
    document.getElementById('mySidebar').style.display = 'block'
  }

  }

  function closetoggle(){
  document.getElementById('mySidebar').style.display = 'none'
  }

    return(
        <div style={{backgroundcolor:'white'}}>

< nav class="w3-sidebar w3-bar-block w3-small w3-hide-small  w3-center ok" id='mSide'>

<img src="/w3images/avatar_smoke.jpg" style={{width:"100%"}} />
<a href="#" class="w3-bar-item w3-button w3-padding-large w3-black">
  <i class="fa fa-home w3-xxlarge"></i>
  <p>HOME</p>
</a>
<a href="#about" class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-user w3-xxlarge"></i>
  <p>ABOUT</p>
</a>
<a href="#photos" class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-eye w3-xxlarge"></i>
  <p>PHOTOS</p>
</a>
<a href="" onClick={Logout} class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-envelope w3-xxlarge"></i>
  <p>Logout</p>
</a>
</nav>

<div class="w3-top">
  <div className="w3-bar w3-white w3-card" id="myNavbar">
    <a href="#home" className="w3-bar-item w3-button w3-wide">VOTE</a>
    <div class="w3-right w3-hide-small">
    
    </div>

    <a href="javascript:void(0)" class="w3-bar-item w3-button w3-right w3-hide-large w3-hide-medium" >
      <i class="fa fa-bars"></i>
    </a>
  </div>
</div>
        </div>
    );
}

export default Main;
